import { useState } from "react";

function Navbar (props) {
    const [items, setItem] = useState("6");

    return (
        <h2> 
            <tr> 5</tr>
            <tr> 4</tr>
            <form>
                <label> Enter something haha
                    <input 
                      type = "text"
                      value = {items}
                      onChange = {(x) => setItem(x ++)}
                      />
                </label>
                <input type = "submit" />
            </form>
        </h2>
    );
}
export default Navbar;
